style:
#header-w {
  background: #231D1A;
}

h1.header-w {
  color: #ffcb05;
  font-size: 2.1em;
}

#main-menu-w {
  background: #231D1A;
}

#header a:link,
#header a:visited {
  color: #FFCA00;
}

#logo img {
  visibility: visible;
}

#show-help {
  background-color: #231D1A;
}
#help-panel {
  background-color: #231D1A;
  border-top: 1px solid #231D1A;
  border-bottom: 2px solid #231D1A;
}
#show-help a.closed:link,
#show-help a.closed:visited {
  color: #D3D1CA;
}
#show-help a.open:link,
#show-help a.open:visited {
  color: #FFCA00;
}
h1 div#space-role {
  color: #FFFEFF;
}
#wiki-content h1 {
  color: #2E4B73;
}
#show-help a.closed:hover, #show-help a.open:hover {
  color: #C8A800;
}
ul#main-menu li {
  margin: 0px 1px 0px;
  background: #8B847E;
  font-weight: bold;
}
ul#main-menu li:hover a {
  background: #8B847E;
  color: #fff;
}
#main-menu a:link,
#main-menu a:visited {
  color: #231C19;
}
#main-menu li.current {
  background: #FFFEFF;
}
div#space-name a:link, div#space-name a:visited {
  color: #FFCA00;
}
h1 div#space-role {
  color: #FFCA00;
}
.more_tabs_menu_item  {
  background-color:#8b847e;
}
.more_tabs_menu_item:hover {
background-color: #58514B;
}
h1 span#space-role {
color:#FFC900;
}
.more_tabs_menu {
background-color:#8B847E;
}
a:link, a:visited {
color:#231C19;
}
div.video-link a {
background:#FFFFFF url(/images/features/bullet-video.png) no-repeat scroll 6px 4px;
}
.skype-settings {
background-color:#FFFFFF;
}
ul#main-menu li a:hover, ul#main-menu li a:active, div#more_menu a:hover {
color:#FFFFFF;
}
ul#main-menu {
height:27px;
}
ul#main-menu li a:link, ul#main-menu li a:visited {
padding:4px 8px 3px;
}
h1 {
font-size:25px;
}

.header-custom-banner {
    padding: 15px 0 !important;
}

